import React from 'react';
import './ImageGrid.css';

const imageList = [
    '1.jpg', '2.jpg', '3.jpg',
    '4.jpg', '5.jpg', '6.jpg'
];

function ImageGrid() {
    return (
        <div className="image-grid">
            {imageList.map((img, index) => (
                <img key={index} src={`/images/${img}`} alt={`img-${index}`} />
            ))}
        </div>
    );
}

export default ImageGrid;
